def countDomNumbersOnN(n):
    lst=[]
    perms = generatePermsOfSizeN(n)
    for i in range(n):
        lst.append(i+1)
    ps = powerset(lst)
    dic={}
    for perm in perms:
        tempGraph = nx.Graph()
        tempGraph.add_nodes_from(perm)
        for i in range(len(perm)):
            for k in range(i+1, len(perm)):
                if perm[k] < perm[i]:
                    tempGraph.add_edge(perm[i], perm[k])
        for p in ps:
            if nx.is_dominating_set(tempGraph,p):
                dom = len(p)
                if dom in dic:
                    dic[dom] += 1
